import * as React from 'react';
import { Button, TextField, Container, Typography, Select, MenuItem, FormControl, InputLabel } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import { Box } from '@mui/material';

export default function RegistrationPage() {
    const [email, setEmail] = React.useState('');
    const [password, setPassword] = React.useState('');
    const [Name, setName] = React.useState('');
    const [confirmPassword, setConfirmPassword] = React.useState('');
    const [isEjustStudent, setIsEjustStudent] = React.useState('');
    const [studentId, setStudentId] = React.useState(''); // State for student ID
    const navigate = useNavigate();

    const register = async () => {
        try {
            if (password !== confirmPassword) {
                alert("Passwords do not match");
                return;
            }

            const payload = { email, password, isEjustStudent };
            if (isEjustStudent === 'yes') {
                if (!studentId) {
                    alert("Please enter your Student ID");
                    return;
                }
                payload.studentId = studentId;
            }

            const response = await fetch("http://localhost:5000/api/register", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json",
                },
                body: JSON.stringify(Name,email,password,isEjustStudent,studentId),
            });

            if (!response.ok) {
                const errorData = await response.json();
                throw new Error(errorData.message || "Unknown error occurred");
            }

            const data = await response.json();
            console.log("Registration successful:", data);

            navigate("/signinPage"); // Redirect to the sign-in page
        } catch (error) {
            console.error("Error during registration:", error.message);
            alert(error.message || "Registration failed. Please try again.");
        }
    };

    return (
        <Box
            sx={{
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
                justifyContent: 'center',
                boxShadow: 3,
                padding: '20px',
                borderRadius: '8px',
                backgroundColor: 'white',
                width: '100%',
                maxWidth: '600px',
                margin: 'auto',
                marginTop: '20px',
                height: 'auto',
                minHeight: '200px',
                '@media (max-width:600px)': {
                    width: '90%',
                    padding: '16px',
                },
            }}
        >
            <img
                src="ejustLogoSignin.png"
                alt="Logo"
                style={{
                    width: '70px',
                    height: 'auto',
                    marginBottom: '16px',
                }}
            />
            <Typography variant="h4" component="h1" gutterBottom>
                Create an Account
            </Typography>
            <TextField
                label="Name"
                type="Name"
                fullWidth
                value={Name}
                onChange={(e) => setName(e.target.value)}
                margin="normal"
            />
            <TextField
                label="Email"
                type="email"
                fullWidth
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                margin="normal"
            />
            <TextField
                label="Password"
                type="password"
                fullWidth
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                margin="normal"
            />
            <TextField
                label="Confirm Password"
                type="password"
                fullWidth
                value={confirmPassword}
                onChange={(e) => setConfirmPassword(e.target.value)}
                margin="normal"
            />
            <FormControl fullWidth margin="normal">
                <InputLabel id="ejust-student-label">Are you an EJUST student?</InputLabel>
                <Select
                    labelId="ejust-student-label"
                    value={isEjustStudent}
                    onChange={(e) => setIsEjustStudent(e.target.value)}
                >
                    <MenuItem value="yes">Yes</MenuItem>
                    <MenuItem value="no">No</MenuItem>
                </Select>
            </FormControl>
            {isEjustStudent === 'yes' && (
                <TextField
                    label="Student ID"
                    type="text"
                    fullWidth
                    value={studentId}
                    onChange={(e) => setStudentId(e.target.value)}
                    margin="normal"
                />
            )}
            <Button
                variant="contained"
                color="primary"
                onClick={register}
                style={{ marginTop: 16 }}
            >
                Register
            </Button>
        </Box>
    );
}
